// import '../App.css';
import {Button} from '../Button';
import './Cover.css';
import cover from './cover.png';
import portrait from './portrait.jpg';

function Cover() {
    return (
        <div className="cover__display">
            <div className="hero-container">
            <div className = 'cover__left'>
                <h1 className="cover__h">SUZANNE AUGUST</h1>
                <p className="cover__p">Young Adult Author</p>
            </div>
            <div className="cover__right">
                <img src={portrait} className="cover__image" />
            </div>
            </div>
        </div>

    )
}

export default Cover
